import React, { PureComponent } from 'react';
import HotPlace from "./HotPlace.js";
import StopTime from "./StopTime.js";
import TicketTypes from "./TicketTypes.js";
import CheckinTime from "./CheckinTime.js";

export default class TouristChartRight extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div>
				<div className="chart-right-whole">
					<div className="chart-area">
						<div className="chart-title">文物统计</div>
						<HotPlace></HotPlace>
					</div>
					<div className="chart-area">
						<div className="chart-title">场馆环境实时数据</div>
						<StopTime></StopTime>
					</div>
					<div className="chart-area">
						<div className="chart-title">游客实时数据</div>
						<TicketTypes></TicketTypes>
					</div>
					<div className="chart-area">
						<div className="chart-title">场馆口碑</div>
						<CheckinTime></CheckinTime>
					</div>
				</div>
            </div>
        );
    }
}
